import React from 'react';


import moment from 'moment'; 
import {Container, Card,Row,Col,Image} from 'react-bootstrap';

const Body = ({weatherData}) => {

  return (
    <div >
        {weatherData ?(
            <Image style={{height:"100%",width:"100%"}}>
         <Container className="mt-5" >
        <Card style={{backgroundColor:"#022D36",color:"white",width:900,height:300 }}>
          <Card.Body >
            <Card.Title style={{ fontSize:30,paddingLeft:340,color:"red"}}>{weatherData.name}</Card.Title>
            <Card.Subtitle >{moment().format('dddd')}, {moment().format('LL')}</Card.Subtitle>
            <Row>
              <Col md={6}>

                <ul style={{ listStyleType: 'none', padding: 0,paddingTop:10 }}>
                  <li>Temprature: {weatherData.main.temp} &deg;C</li>
                  <li>Humidity: {weatherData.main.humidity} %</li>

                </ul>
              </Col>
              <Col md={6}>

                <ul style={{ listStyleType: 'none', padding:0,position:'absolute' }}>
                  <li>Sunrise: {new Date(weatherData.sys.sunrise * 1000).toLocaleTimeString('en-IN')}</li>
                  <li>Sunset: {new Date(weatherData.sys.sunset * 1000).toLocaleTimeString('en-IN')}</li>

                </ul>
              </Col>
            </Row>

          </Card.Body>
        </Card>
      </Container>
      </Image>
        ):<div><h1><Image style={{height:"100%",width:"100%"}} src="https://img.freepik.com/free-photo/cloud-blue-sky_1232-3108.jpg?size=626&ext=jpg&uid=R114846786&ga=GA1.2.1460528128.1693521964&semt=ais" /></h1></div>}


    </div>
  );
}

export default Body;
